import axios from "axios"
import {useEffect, useState} from "react"

function Myorders(){

    var [myorders,setMyorders] = useState()
    var i =0;
    useEffect(()=>{
        axios({
            url: 'https://apibyashu.herokuapp.com/api/cakeorders',
            method: "post",
            headers: {
            authtoken:  localStorage.token
            },
            data:{}
        }).then((response) => {
            console.log('response',response.data.cakeorders)
            setMyorders(response.data.cakeorders)
            // props.dispatch({
            // type: "ORDER_DONE",
            // })

        }, (error) => {
            console.log("response from cakeorders api : ", error)
        })
    },[])
    return(
        <>
        <h4>MY Orders</h4>
        <table className="table table-hover"><thead><tr>
            <th>Order Number</th>
            <th>Date</th>
            <th>Status</th>
            <th>Pay Mode</th>
            <th>Products</th>
            </tr></thead>
            <tbody>


        {myorders?.length >0 && myorders.map((each,index) => {
            i++;
            <tr>
                <td>{i}</td>
                <td>{each.orderdate}</td>
                <td></td>
                <td></td>
                <td></td>
            </tr>


        })
        }

   </tbody>
   </table>
        </>
    )
}

export default Myorders
